import React, { useState, useEffect } from "react";
import { Route } from "react-router-dom";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import CssBaseline from "@material-ui/core/CssBaseline";
import Drawer from "@material-ui/core/Drawer";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import List from "@material-ui/core/List";
import Typography from "@material-ui/core/Typography";
import Divider from "@material-ui/core/Divider";
import IconButton from "@material-ui/core/IconButton";
import Badge from "@material-ui/core/Badge";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import ExitToAppRoundedIcon from "@material-ui/icons/ExitToAppRounded";
import { mainListItems, secondaryListItems } from "./listItems";

import Main from "./main";
import CreatePolicy from "./createPolicy";
import UpdatePolicy from "./updatePolicy";
import PrivatePolicies from "./privacyPolicies";
import Users from "../main.js/users";
import UpdateUser from "./updateuser";
import Notifications from "./notifications";
import LimitsConstraints from "./limitsConstraints";
import GrantPermissions from "./grantPermissions";
import AccessRequests from "./accessRequests";

const drawerWidth = 240;

const useStyles = makeStyles(theme => ({
  root: {
    display: "flex"
  },
  toolbar: {
    paddingRight: 24 // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
    padding: "0 8px",
    ...theme.mixins.toolbar
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    })
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen
    })
  },
  menuButton: {
    marginRight: 36
  },
  menuButtonHidden: {
    display: "none"
  },
  title: {
    flexGrow: 1
  },
  drawerPaper: {
    position: "relative",
    whiteSpace: "nowrap",
    width: drawerWidth,
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen
    })
  },
  drawerPaperClose: {
    overflowX: "hidden",
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing(9)
    }
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: "100vh",
    overflow: "auto"
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4)
  },
  paper: {
    padding: theme.spacing(2),
    display: "flex",
    overflow: "auto",
    flexDirection: "column"
  },
  fixedHeight: {
    height: 240
  }
}));

export default function AdminDashboard(props) {
  const classes = useStyles();

  const [open, setOpen] = React.useState(true);
  const handleDrawerOpen = () => {
    setOpen(true);
  };
  const handleDrawerClose = () => {
    setOpen(false);
  };
  const [adminID, setAdminID] = useState("");
  useEffect(() => {
    if (localStorage.getItem("adminToken")) {
      setAdminID(localStorage.getItem("adminID"));
    } else {
      props.history.push("/adminlogin");
    }
  }, [props.history]);
  const onClick = () => {
    localStorage.removeItem("adminToken");
    localStorage.removeItem("adminID");
    props.history.push("/adminlogin");
  };

  return (
    <Router>
      <div className={classes.root}>
        <CssBaseline />
        <AppBar
          position="absolute"
          className={clsx(classes.appBar, open && classes.appBarShift)}
        >
          <Toolbar className={classes.toolbar}>
            <IconButton
              edge="start"
              color="inherit"
              aria-label="open drawer"
              onClick={handleDrawerOpen}
              className={clsx(
                classes.menuButton,
                open && classes.menuButtonHidden
              )}
            >
              <MenuIcon />
            </IconButton>
            <Typography
              component="h1"
              variant="h6"
              color="inherit"
              noWrap
              className={classes.title}
            >
              {"Dashboard"}
            </Typography>
            <IconButton color="inherit">
              <Badge color="secondary">
                <ExitToAppRoundedIcon onClick={onClick} />
              </Badge>
            </IconButton>
          </Toolbar>
        </AppBar>
        <Drawer
          variant="permanent"
          classes={{
            paper: clsx(classes.drawerPaper, !open && classes.drawerPaperClose)
          }}
          open={open}
        >
          <div className={classes.toolbarIcon}>
            <IconButton onClick={handleDrawerClose}>
              <ChevronLeftIcon />
            </IconButton>
          </div>
          <Divider />
          <List>{mainListItems}</List>
          <Divider />
          <List>{secondaryListItems}</List>
        </Drawer>
        <Switch>
          <Route exact path="/admindashboard/main" component={Main} />
          <Route
            exact
            path="/pricatepolicies/createpolicy"
            component={CreatePolicy}
          />
          <Route
            exact
            path="/admindashboard/pricatepolicies/updatepolicy"
            component={UpdatePolicy}
          />
          <Route
            exact
            path="/admindashboard/pricatepolicies"
            component={PrivatePolicies}
          />
          <Route
            exact
            path="/admindashboard/accessrequests"
            component={AccessRequests}
          />
          <Route exact path="/admindashboard/users" component={Users} />
          <Route
            exact
            path="/admindashboard/users/updateuser"
            component={UpdateUser}
          />
          <Route
            exact
            path="/admindashboard/notifications"
            component={Notifications}
          />
          <Route
            exact
            path="/admindashboard/limitconstraints"
            component={LimitsConstraints}
          />
          <Route
            exact
            path="/admindashboard/grantpermissions"
            component={GrantPermissions}
          />
        </Switch>
      </div>
    </Router>
  );
}
